import React from 'react';
import 'header.css'

function Headers(props) {
  return (
    <>
      <div>
        <div className='header-container'>
          <IonTitle>{props.headersTitle}hi</IonTitle>
          <img src='d'>{}</img>
          <ul>
            <li>Login in</li>
            <li>all Post</li>
          </ul>
        </div>
      </div>
    </>
  )
}

export default Headers
